import { useEffect } from 'react';
import Link from 'next/link';
import Image from 'next';
import Layout from '../components/layout';
import CartInstances from '../components/CartInstances';
import { useUserDispatch, useUser } from './contexts/userContext';
import { useIns, useInsDispatch } from './contexts/CartContext';
import { usefunctions } from './contexts/functionContext';
import { useInitial, useInitialDispatch } from './contexts/initialContext';
import { formatNumber } from '../utils/utils';

export default function Order() {
    var temp;
    const user = useUser();
    const setUser = useUserDispatch();

    const { instances, itemCount, total, orders } = useIns();
    const {
        setInstance,
        setInsLen,
        setItemCount,
        setTotal,
        setOrders,
    } = useInsDispatch();
    const { GetAllCarts, checkdb, toCheckOut, GetAllOrder } = usefunctions();

    const setInitial = useInitialDispatch();
    const inital = useInitial();

    useEffect(() => {
        user && GetAllOrder(user, setOrders);
    }, [orders]);

    return (
        <Layout>
            <div className="container mt-3">
                <div className="row">
                    <table class="table">
                        <thead class="thead-light">
                            <tr>
                                <th>Your orders</th>
                                <th>name</th>
                                <th>unit price</th>
                                <th>quantity</th>
                                <th></th>
                            </tr>
                        </thead>
                        <tbody>
                            {orders &&
                                orders.map((order) => {
                                    return (
                                        <tr>
                                            <td>
                                                <Link
                                                    href="/store/[id]"
                                                    as={`store/${order.item._id}`}
                                                >
                                                    <a className="btn btn-link btn-sm mr-2">
                                                        <img
                                                            src={`/${order.item.image}`}
                                                            height={70}
                                                            width={70}
                                                        />
                                                    </a>
                                                </Link>
                                            </td>
                                            <td>
                                                <div className="align-self-center mr-2">
                                                    <Link
                                                        href="/store/[id]"
                                                        as={`store/${order.item._id}`}
                                                    >
                                                        <a className="btn btn-link btn-sm  ">
                                                            {order.item.title}
                                                        </a>
                                                    </Link>
                                                </div>
                                            </td>
                                            <td>
                                                <div className=" align-self-center mr-2">
                                                    {formatNumber(
                                                        order.item.price
                                                    )}
                                                </div>
                                            </td>
                                            <td>
                                                <div className="align-self-center mr-3">
                                                    {order.quantity}
                                                </div>
                                            </td>
                                            <td>
                                                <div className="align-self-center mr-3">
                                                    <Router>
                                                        <div>
                                                            <h2>Accounts</h2>

                                                            <ul>
                                                                <li>
                                                                    <Link to="/netflix">
                                                                        Netflix
                                                                    </Link>
                                                                </li>
                                                                <li>
                                                                    <Link to="/zillow-group">
                                                                        Zillow
                                                                        Group
                                                                    </Link>
                                                                </li>
                                                                <li>
                                                                    <Link to="/yahoo">
                                                                        Yahoo
                                                                    </Link>
                                                                </li>
                                                                <li>
                                                                    <Link to="/modus-create">
                                                                        Modus
                                                                        Create
                                                                    </Link>
                                                                </li>
                                                            </ul>

                                                            <Switch>
                                                                <Route
                                                                    path="/:id"
                                                                    children={
                                                                        <Child />
                                                                    }
                                                                />
                                                            </Switch>
                                                        </div>
                                                    </Router>
                                                    comment
                                                </div>
                                            </td>
                                        </tr>
                                    );
                                })}
                        </tbody>
                    </table>
                </div>
            </div>
        </Layout>
    );
}
